import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
const root = ReactDOM.createRoot(document.getElementById("root"));
let name = "ali";
let age = 17;
root.render(
  <>
    <Text name={name} text1={age} />
  </>
);

function Text({ name, age }) {
  return (
    <div>
      <p>{name}</p>
    </div>
  );
}
